import { v4 as uuidv4 } from "uuid";
const initialState = "";

const sessionReducers = (state = initialState, action) => {
  switch (action.type) {
    case "CREATE_SESSION_ID":
      state = uuidv4();
      return state;
    default:
      return state;
  }
};

export default sessionReducers;
